#[Window(events=CommandBarEvents,commands:[Scale,RenderMethod])]
struct MyWin {
    himg: Handle<ImageViewer>,
}
impl MyWin {
    fn new() -> Self {
        let mut w = Self {
            base: window!("Image,d:c,w:100%,h:100%,flags: Sizeable"),
            himg: Handle::None,
        };
        let mut ferris = Image::new(120, 90).unwrap();
        for y in 0..90 {
            for x in 0..120 {
                ferris.set_pixel(x, y, Pixel::from(FERRIS_PIXELS[(y * 120 + x) as usize]));
            }
        }
        let i = ImageViewer::new(
            ferris,
            Layout::new("d:c"),
            image::RenderMethod::AsciiArt,
            image::Scale::NoScale,
            image_viewer::Flags::ScrollBars,
        );
        w.himg = w.add(i);
        w
    }
}
impl CommandBarEvents for MyWin {
    fn on_update_commandbar(&self, commandbar: &mut CommandBar) {
        commandbar.set(key!("F1"), "Scale", mywin::Commands::Scale);
        commandbar.set(key!("F2"), "Method", mywin::Commands::RenderMethod);
    }

    fn on_event(&mut self, command_id: mywin::Commands) {
        let h = self.himg;
        if let Some(img) = self.control_mut(h) {
            match command_id {
                mywin::Commands::Scale => {
                    if img.scale() == image::Scale::NoScale {
                        img.set_scale(image::Scale::Scale50);
                    } else {
                        img.set_scale(image::Scale::NoScale);
                    }
                }
                mywin::Commands::RenderMethod => todo!(),
            }
        }
    }
}

fn main() -> Result<(), appcui::system::Error> {
    let mut a = App::new().command_bar().build()?;
    a.add_window(MyWin::new());
    a.run();
    Ok(())
}
